(653, '0212100653', '2021-08-04 12:25:37', 247, '2021-06-04', 185400, '1', '0', NULL, 50, 12, 21, 'ESTÁ INCLUSO NO EQUIPAMENTO MÃO DE OBRA DE INSTALAÇÃO FICANDO A EMPRESA COMPRADORA RESPONSÁVEL APENAS PELA ALIMENTAÇÃO E ESTADIA DE NOSSOS COLABORADORES.\r\n\r\nA ENTREGA DO EQUIPAMENTO SERÁ FEITA COM CAMINHÃO DA EMPRESA VENDEDORA, SENDO QUE O CUSTO DE COMBUSTÍVEL SERÁ POR CONTA DA COMPRADORA.\r\n\r\nTAMBÉM ESTÁ INCLUSO NO VALOR DA NEGOCIAÇÃO A INSTALAÇÃO DE PLATAFORMAS E ESCADAS PARA A MANUTENÇÃO E LIMPEZA DOS EQUIPAMENTOS.\r\n\r\nTAMBÉM SERÁ FABRICADO PARA A COMPRADORA O SISTEMA DE MISTURA E DOSAGEM DOS ADITIVOS PARA CONCRETO, O QUAL SERÁ AUTOMATIZADO NÃO PRECISANDO A INTERVENÇÃO HUMANA PARA SEU FUNCIONAMENTO, O EQUIPAMENTO TERÁ O CUSTO MÁXIMO NO VALOR DE R$5.000,00 (CINCO MIL REAIS) O QUAL NÃO ESTÁ INCLUSO NA NEGOCIAÇÃO, E SERÁ COMBINADO A PARTE DESTE PEDIDO O SEU PAGAMENTO DEPOIS DO TERMINO DA INSTALAÇÃO.\r\n\r\nO PAGAMENTO SERÁ REALIZADO DA SEGUINDO FORMA, SERÁ PAGO COMO SINAL DE NEGOCIAÇÃO O VALOR DE R$92.700,00 (NOVENTA E DOIS MIL E SETECENTOS REAIS), NO ATO DO FECHAMENTO DO PEDIDO ATRAVÉS DE PAGAMENTO DE CARTÃO DE CREDITO, O RESTANTE SERÁ PAGO EM 12 PARCELAS IGUAIS NO VALOR DE R$7.725,00 (SETE MIL SETECENTOS E VINTE E CINCO REAIS) SENDO A PRIMEIRA PARA O DIA 04/06/2021 E AS DEMAIS A CADA 30 DIAS SUBSEQUENTES.\r\n', '', 0, '2021-08-04', 0, '', 0, ''),
(654, '0222100654', '2021-05-04 19:24:46', 479, '2021-06-14', 89260, '1', '0', NULL, 50, 1, 22, 'ORÇAMENTO VALIDO ATE DIA 15/05/2021, APÓS HAVERÁ REAJUSTE DE VALORES DE MATERIAIS. \r\nFRETE POR CONTA DA EMPRESA COMPRADORA .', '', 0, '2021-05-25', 0, '', 0, ''),
(655, '0152100655', '2021-05-05 17:41:21', 479, '2021-07-06', 145400, '1', '0', 3, 50, 6, 15, 'ACORDADO :\r\nO VALOR TOTAL COM DESCONTO SERÁ DE R$ 140,000,00 , QUE SERÁ PAGO DA SEGUINTE FORMA : \r\nR$ 40.000,00 EM DEPOSITO BÁNCARIO ATÉ A  DATA DE 12 / 05/ 2021 NA CONTA INDICADA , E O RESTANTE NO VALOR DE R$ 100,000,00 ATRAVÉS DE CARTA DE CRÉDITO A SER LIBERADA NO PRAZO DE ATÉ 90 DIAS .\r\nENTREGA IMPRETERIVELMENTE PARA 60 DIAS , NAO ULTRAPASSANDO ESSA DATA, QUE TERÁ INICIO A PARTIR DO DEPÓSITO BANCÁRIO DA ENTRADA. \r\nTRANSPORTE POR CONTA DA EMPRESA COMPRADORA \r\n', '1', 1, '2021-05-25', 0, '', 0, ''),
