(508, '(ITEM CANCELADO) ESPECIAL PRENSA HIDRÁULICA PARA BLOCOS E PISOS AUTOMÁTICA SBA-2', 30000, '0', 0, 0, 0, 0, 'SBA-2', 'PRENSA HIDRÁULICA PARA BLOCOS E PISOS AUTOMÁTICA SBA-2\r\n* O EQUIPAMENTO SERÁ SEMI NOVO.. SOMENTE CILINDROS E ROLAMENTOS NOVOS.\r\n* ESTARÁ INCLUSO UMA MATRIZ PARA BLOCOS QUE SERÁ DETERMINADO O MODELO.\r\n\r\nDESCRIÇÃO TÉCNICA:\r\n         \r\nCOMPOSIÇÃO DA MAQUINA\r\n* SILO PARA ARMAZENAMENTO\r\n* ALIMENTADOR DE PALETES \r\n* ALIMENTADOR DE CONCRETO\r\n* ESTEIRA DE SAÍDA\r\n* PRENSA E DESMOLDE HIDRÁULICOS\r\n\r\nDADOS DE PRODUÇÃO\r\n - TEMPO APROXIMADO DE CICLO 30SEG\r\n* BLOCO 09 X 19 X 39 – 6 PEÇAS\r\n* BLOCO 14 X 19 X 39 – 4 PEÇAS\r\n* BLOCO 19 X 19 X 39 – 3 PEÇAS\r\n* PISO 10 X 20 – 12 PEÇAS\r\n* PISO 16 FACES – 10 PEÇAS\r\n\r\nDADOS ELETRÔNICOS \r\n* EQUIPAMENTO TRIFÁSICO\r\n* 01 MOTOR 10CV – UNIDADE HIDRÁULICA\r\n* 01 MOTOR 3CV – MOTOR VIBRADOR (PODERÁ VIR EQUIPADO COM 2 MOTORES)\r\n\r\nCOMPOSIÇÃO DE SISTEMAS HIDRÁULICOS E ELETRÔNICOS\r\n* 04 CILINDROS HIDRÁULICOS\r\n* 01 RESERVATÓRIO DE ÓLEO\r\n* 01 COMANDO DE OPERAÇÃO\r\n', 1, '1'),
(509, 'ESPECIAL PONTE PARA 5TN', 64000, '0', 0, 0, 0, 0, 'PONTE', '01 CORPO DE PONTE PARA 14M - VIGA DUPLA\r\n02 CABECEIRAS MOTORIZADAS PARA PORTICO 5TN\r\n- MOTORIZAÇÃO 3CV CADA MOTOR\r\n\r\n01 TALHA PARA 5 TONELADAS PARA ATÉ 5 METROS ELEVAÇÃO\r\n- MOTORIZAÇÃO 5CV MOTO FREIO\r\n01 TROLLER PARA PONTE VIGA DUPLA\r\n- MOTORIZAÇÃO 3CV\r\n\r\n01 PAINEL ELETRICO COM 6 COMANDOS\r\n01 CONTROLE REMOTO PARA 6 MOVIMENTAÇÕES \r\n\r\n', 4, '1'),
(510, 'ESPECIAL PORTICO MOTORIZADO PARA 1.2TN', 26000, '0', 0, 0, 0, 0, 'PORTICO', '01 TALHA PARA 1.2TN\r\n- MOTORIZAÇÃO 1.5CV\r\n\r\n01 TROLLER ELETRÔNICO PARA 1.2TN\r\n- MOTORIZAÇÃO 1.5CV\r\n\r\n01 VIGA PRINCIPAL PARA TALHA\r\n\r\n02 PÉ PARA PÓRTICO 1,2TN\r\n\r\n02 CABECEIRA MOTORIZADA PARA PÓRTICO \r\n- MOTORIZAÇÃO 1.5CV\r\n\r\n01 PAINEL DE AUTOMAÇÃO PARA 06 COMANDOS\r\n\r\n01 BOTOEIRA PARA 6 COMANDOS', 4, '1'),
(511, 'TALHA PARA 4TN', 12000, '5', 17, 1, 3, 10, 'TEA-4', 'TALHA ELETRÔNICA PARA 4TN\r\n\r\n* MOTORIZAÇÃO PRINCIPAL 5CV\r\n* SISTEMA DE FREIO - MAGNÉTICO\r\n* QUANTIDADE DE CABOS - 3 CABOS\r\n\r\nSISTEMAS ELETRÔNICOS\r\n* PAINEL ELÉTRICO INCLUSO\r\n* BOTOEIRA PARA 2 FUNÇÕES\r\n* ALIMENTAÇÃO TRIFÁSICO', 4, '1'),
(512, 'TROLLER PARA PONTE VIGA DUPLA PARA ATÉ 5TN', 13000, '0', 0, 0, 0, 0, 'TROLLER', 'TROLLER ELETRICO PARA VIGA DUPLA DE PONTE ATÉ 5TN\r\n* MOTORIZAÇÃO 3CV', 4, '1'),
(513, 'ESPECIAL USINA PARA AGREGADOS DE CONCRETO - CÓDIGO FINAME (03919980)', 46100, '0', 0, 0, 0, 0, 'TOGO', '1 TOGO PARA PESAGEM DE AGREGADOS 1M3  - CÓDIGO FINAME (03919980)\r\nTOGO PARA PESAGEM DE AGREGADOS\r\n- SILO PARA 1M3\r\n- ESTEIRA PARA 5M\r\n- 03 CÉLULAS DE CARGA\r\n- PAINEL DE AUTOMAÇÃO\r\n- LETREIRO DIGITAL GRANDE\r\n- CONTROLE REMOTO PARA COMPORTA\r\nOBS. NÃO ACOMPANHA COMPRESSOR DE AR\r\nMAIS PODE SER INSTALADO NO EQUIPAMENTO.', 12, '1'),
